import React from 'react'

export default function TextForm() {
  return (
    <>
 
<div className="mb-3">
  <label for="mybox" className="form-label">Enter Your Text Below</label>
  <textarea className="form-control" id="mybox" rows="3"></textarea>
</div>
</>
  )
}
